window.bookSummaryJSON = "<p>In 2006, Nalini Singh introduced the beguiling and sensual Psy-Changeling world in <i>Slave to Sensation,</i> which spawned a series that has had readers and critics cheering. Throughout the incredible 11-book run there has been one question that has tantalized Nalini's legion of fans. Now, in the eagerly awaited 12th book in the series, Nalini Singh finally reveals the answer to the biggest Psy-Changeling mystery - an answer so surprising we wouldn't dare spoil it. Even if we knew.</p>"; 
